import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { RouterProvider, createBrowserRouter, RedirectFunction, redirect } from 'react-router-dom';

const router = createBrowserRouter([
  {
    path: "/",
    action: () => redirect("/paintings"),
  },
  {
    path: "/paintings",
    element: <App />,
  },
]);

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <RouterProvider router={router} />
  </React.StrictMode>
);
